export class User{

    userId?: string | any
    userName?: string
    address?: string
    email?: string
    phone?: string
    task?: string


    constructor() {
    
        this.userId = "";
        this.userName = "";
        this.address = "";
        this.email="";
        this.phone = "";
        this.task ="";
     
    
    }
}
